import logo from './logo.svg';
import './App.css';
import './css/home.css';
import HeaderComponent from './components/HeaderComponent';
import FooterComponent from './components/FooterComponent';
import ProductList from './components/ProductList';

function App() {
  return (
    <div className="App">

          <HeaderComponent/>

            <ProductList/>

          <FooterComponent/> 

    </div>
  );
}

export default App;
